import React, {useState} from 'react'

import babyData from './data/babyNamesData.json'

const Search = (list) => {
  const filter = () => {

<div className="content">
      {list.map((baby, index) => (
        <span key={index} className={baby.sex === 'f' ? 'girl' : 'boy'}>
          {baby.name}
        </span>
      ))}
    </div>
  }
  <div className="content">
    <input
      className="form-control"
      type="text"
      placeholder="Search..."
      onKeyUp={filter()}
    />
  </div>
}

export default Search
